docs/introduction/Drawbacks.html.body:
Drawbacks
Like every solution, also Fela is not the ultimate solution and should not be blindly used without evaluating its benefits and disadvantages. The strict design decisions also have some drawbacks.
1. Computed Selectors
The unique computed selectors are quite handy as they prevent namespacing conflicts. But they are not designed to be human-readable nor to be mutated at all. 
However, if you need to mutate the styles from outside, consider providing an API to pass the props.
2. Shorthand &amp; Longhand Properties
Probably the biggest downside of using atomic CSS design, is the fact that shorthand and longhand properties can&apos;t safely be mixed in a single rule.
const rule = props =&gt; ({
  border: &apos;1px solid black&apos;,
  borderColor: &apos;red&apos;
})

The above example will not unconditionally render a red border as we can&apos;t tell which rule might be rendered before and therefore appears first in the stylesheet. There might have been another rule that renders borderColor: red which is rendered before this rule. Now rendering this rule, would cause border: 1px solid black to always be preferred based on how CSS specificity works.
To solve this problem, you should not use shorthand and longhand properties together in a single rule. Perhaps the best is to avoid them at all. To give you an example, here&apos;s how you would write the above:
const rule = props =&gt; ({
  borderStyle: &apos;solid&apos;,
  borderWidth: &apos;1px&apos;,
  borderColor: &apos;red&apos;
})

It might be more code to type, but its also more self-explanatory and descriptive.

PS: There will soon be a tool, that automatically checks for mixed shorthand / longhand properties and throws a warning if used together.

docs/basics/Rules.html.body:
Rules
We need to understand what rules actually are and what they&apos;re used for. The name comes, as you might have already guessed, from CSS itself.
In CSS a rule is defined as a pair of selector(s) and style declaration(s) as this image from MDN shows:

In Fela you do not need to set the selector as it is generated automatically. Also instead of using static style declarations, every rule instead is a pure function of props that returns a style object. 
(props) =&gt; ({ /* style declarations */ })

Pure functions produce predictable output, are easy to test and are quite fail-safe. To keep your selectors pure you should not:

Mutate the props
Perform side effects e.g. API calls
Call non-pure functions e.g. Date.now()

Style Object
The objects returned by rules are called style objects, if they conform a special shape. Rules can only be rendered if they actually fit this shape for any given props.
1. Basic Shape
First of all there is the basic shape which just consists of simple style declarations.
Properties should be written in camel-case.
const rule = props =&gt; ({
  fontSize: &apos;15px&apos;,
  color: props.color,
  lineHeight: 1.5
})

2. Pseudo Classes
Pseudo classes are one of the key features of CSS. They let you add interactive behavior to your basic styles. You can easily define them as nested property objects within your rules. You can also nest them to require both pseudo classes to be active.
const rule = props =&gt; ({
  color: &apos;red&apos;,
  fontSize: &apos;12px&apos;,
  &apos;:hover&apos;: {
    color: &apos;blue&apos;,
    // they can be nested to achieve
    // e.g. :hover:active
    &apos;:active&apos;: {
      color: &apos;yellow&apos;
    }
  },
  &apos;:active&apos;: {
    color: &apos;black&apos;
  }
})

3. Media Queries
Yet another CSS key feature are media queries. They&apos;re used to describe what styles are rendered depending on the current screen width/height, aspect ratio, device etc. Just like pseudo classes they can also be nested within your rules. In addition they can even have nested pseudo classes themselves.
const rule = props =&gt; ({
  color: &apos;red&apos;,
  &apos;:hover&apos;: {
    color: &apos;blue&apos;
  },
  &apos;@media (min-height: 200px)&apos;: {
    color: &apos;yellow&apos;,
    // they can be nested to achieve e.g.
    // @media (min-height: 200px) and (max-width: 300px)
    &apos;@media (max-width: 300px)&apos;: {
      color: &apos;purple&apos;
    }
  },
  &apos;@media (screen)&apos;: {
    color: &apos;black&apos;
  }
})

4. Attribute Selectors
To be able to style elements according to their attributes, Fela introduces a special syntax for nested attribute selectors. It allows dynamic styles depending on passed attributes which adds another level of precise element selection.
The API reflects the original CSS attribute selectors and therefore allows the following operators:

=: attributes equal to a value
~=: attributes containing a value
^=: attributes beginning with a value
|=: attributes starting with a value (whole word)
$=: attributes ending with a value

Only passing the attributes checks if the attribute is present at all.

Note: Use attribute selectors with caution as they add complexity to your styling and have higher specificity as other selectors.

const rule = props =&gt; ({
  color: &apos;red&apos;,
  &apos;[checked=&quot;true&quot;]&apos;: {
    color: &apos;yellow&apos;,
    // they can be nested to achieve e.g.
    // [checked=&quot;true&quot;][target]
    &apos;[target]&apos;: {
      color: &apos;purple&apos;
    }
  },
  &apos;[data-name^=&quot;A&quot;]&apos;: {
    color: &apos;black&apos;
  }
})

5. Child Selectors
Fela also supports a special syntax for child element styling know as child selectors in CSS.
They should only be used for third-party class manipulation or semantic problems e.g. parent component which defines how child components are ordered depending on some state.

Note: Use child selectors with caution as they add complexity to your styling and have higher specificity as other selectors.

const rule = props =&gt; ({
  color: &apos;red&apos;,
  &apos;&gt; h1&apos;: {
    color: &apos;blue&apos;,
    // they can contain nested objects e.g.
    // &gt; h1:hover
    &apos;:hover&apos;: {
      color: &apos;black&apos;
    }
  },
  &apos;&gt; #hardcoded&apos;: {
    color: &apos;yellow&apos;,
    // they can be nested to achieve e.g.
    // &gt; #hardcoded &gt; .third-party
    &apos;&gt; .third-party&apos;: {
      color: &apos;purple&apos;
    }
  }
})

6. Other Selectors
If you are familiar with CSS, you may have noticed that this was just very small subset of CSS selectors. While we only support the above selectors for a reason, we also understand that there might be some edge cases (mostly with third-party libraries) where you want to use other selectors as well. Therefore we provide the &amp;-prefix for nested selectors.

Warning: This is experimental. It basically renders the selector without any further validation.

const rule = props =&gt; ({
  color: &apos;red&apos;,
  // .a .sub-class
  &apos;&amp; .sub-class&apos;: {
    color: &apos;blue&apos;,
    // they can contain nested objects e.g.
    // .a .sub-class:hover
    &apos;:hover&apos;: {
      color: &apos;black&apos;
    }
  }
})



