docs/advanced/ServerRendering.html.body:
Server Rendering
As already mentioned, Fela supports server-side rendering out of the box.
All you need to to is call renderToString once you are finished rendering styles and you will get the final CSS markup.
That&apos;s it. No magic. No extra configuration.
Usually you will render all styles on the server and inject the rendered CSS markup into the HTML markup which gets sent to the client.
Example
The following code shows a simple server example using express and React.
import React from &apos;react&apos;
import { renderToString } from &apos;react-dom/server&apos;
import { createRenderer } from &apos;fela&apos;

import express from &apos;express&apos;

const rule = props =&gt; ({
  color: props.color,
  fontSize: &apos;15px&apos;
})

// simplified demo app
const App = ({ renderer }) =&gt; (
  &lt;div className={renderer.renderRule(rule, { color: &apos;blue&apos; })}&gt;
    Hello World
  &lt;/div&gt;
)

// Our initial html template
const appHTML = `
&lt;!DOCTYPE html&gt;
&lt;html&gt;
&lt;head&gt;
  &lt;style id=&quot;stylesheet&quot;&gt;
    &lt;!-- {{css}} --&gt;
  &lt;/style&gt;
  &lt;title&gt;Fela - Server Rendering&lt;/title&gt;
&lt;/head&gt;
&lt;body&gt;
  &lt;div id=&quot;app&quot;&gt;
    &lt;!-- {{app}} --&gt;
  &lt;/div&gt;
&lt;/body&gt;
&lt;/html&gt;
`

const server = express()

server.get(&apos;/&apos;, (req, res) =&gt; {
  const renderer = createRenderer()

  const htmlMarkup = renderToString(
    &lt;App renderer={renderer} /&gt;
  )

  const cssMarkup = renderer.renderToString()
  // inject the rendered html and css markup into the basic app html
  res.write(appHTML.replace(&apos;&lt;!-- {{app}} --&gt;&apos;, htmlMarkup).replace(&apos;&lt;!-- {{css}} --&gt;&apos;, cssMarkup))
  res.end()
})
// provide the content via localhost:8080
server.listen(8080, &apos;localhost&apos;)

Output (localhost:8080)
&lt;!DOCTYPE html&gt;
&lt;html&gt;
&lt;head&gt;
  &lt;style id=&quot;stylesheet&quot;&gt;
    .a{color:blue}.b{font-size:15px}
  &lt;/style&gt;
  &lt;title&gt;Fela - Server Rendering&lt;/title&gt;
&lt;/head&gt;
&lt;body&gt;
  &lt;div id=&quot;app&quot;&gt;
    &lt;div class=&quot;a b&quot;&gt;
      Hello World
    &lt;/div&gt;
  &lt;/div&gt;
&lt;/body&gt;
&lt;/html&gt;



