docs/advanced/RendererConfiguration.html.body:
Renderer Configuration
We already learned that the renderer is configurable with e.g. plugins, but there are some more options.
In general, our renderer accepts a config object. The following table shows each configuration option, its expected value, its default value and what it is used for.
We might introduce more configuration options with future releases, so be sure to frequently check for updates.



Option
Value
Default
Description




plugins
function[]

A list of plugins to process styles before rendering


keyframePrefixes
string[]
[&apos;-webkit-&apos;,&apos;-moz-&apos;]
A list of which additional @keyframes prefixes are rendered


enhancers
function[]

A list of enhancers to enhance the renderer


mediaQueryOrder
string[]
[]
An explicit order in which media query rules are rendered


selectorPrefix
string
&apos;&apos;
Prepend a static prefix to every every generated class and keyframe



Example
import { createRenderer } from &apos;fela&apos;

import prefixer from &apos;fela-plugin-prefixer&apos;
import unit from &apos;fela-plugin-unit&apos;
import fallbackValue from &apos;fela-plugin-fallback-value&apos;

import beautifier from &apos;fela-beautifier&apos;

const config = {
  plugins: [ unit(&apos;em&apos;), prefixer(), fallbackValue() ],
  keyframePrefixes: [&apos;-webkit-&apos;],
  enhancers: [ beautifer() ],
  mediaQueryOrder: [
    &apos;(min-height: 300px)&apos;,
    &apos;(min-height: 500px)&apos;
  ],
  selectorPrefix: &apos;fela_&apos;
}

const renderer = createRenderer(config)

const keyframe = props =&gt; ({
  from: {
    width: &apos;calc(100% - 50px)&apos;,
    height: props.height *  2
  },
  to: {
    width: &apos;calc(50% - 50px)&apos;,
    height: props.height
  }
})

const rule = props =&gt; ({
  color: props.color,
  fontSize: 12
})

renderer.renderRule(rule, { color: &apos;red &apos;})
renderer.renderKeyframe(keyframe, { height: 100 })

console.log(renderer.renderToString())

@-webkit-keyframes fela_k1 {
  from {
    width: -webkit-calc(100% - 50px);
    width: -moz-calc(100% - 50px);
    width: calc(100% - 50px);
    height: 200em
  }

  to {
    width: -webkit-calc(50% - 50px);
    width: -moz-calc(50% - 50px);
    width: calc(50% - 50px);
    height: 100em
  }
}

@keyframes fela_k1 {
  from {
    width: -webkit-calc(100% - 50px);
    width: -moz-calc(100% - 50px);
    width: calc(100% - 50px);
    height: 200em
  }

  to {
    width: -webkit-calc(50% - 50px);
    width: -moz-calc(50% - 50px);
    width: calc(50% - 50px);
    height: 100em
  }
}

.fela_a {
  color: red
}

.fela_b {
  font-size: 12px
}



