docs/advanced/StaticStyle.html.body:
Global &amp; Third-Party Styles
It is a common technique to start the whole styling process by adding some global styles such as CSS resets.
In addition you might also include some fancy third-party styles. For this the renderer provides a method called renderStatic.
It accepts either a valid CSS string or a basic style object with a custom selector to be rendered into.
Style Object
If you prefer using style objects, do not forget to provide a selector as well.

Note: Style objects will also be processed with all applied plugins.

import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer()

const styleObject = {
  fontSize: &apos;12px&apos;,
  width: &apos;100%&apos;,
  display: &apos;flex&apos;
}

renderer.renderStatic(styleObject, &apos;html,body,#app&apos;)

CSS String
Rendering CSS strings is especially helpful if you want to use third-party or legacy styles written in CSS.
This method is not recommended as no further processing with plugins is done. It only be used to insert large third-party CSS files.
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer()

renderer.renderStatic(&apos;*{margin:0;padding:0}&apos;)

Using ECMAScript 2015 template strings we can even write multi-line CSS styles. This is helpful if we want to copy large CSS files directly into our JavaScript file.
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer()

renderer.renderStatic(`
  * {
    margin: 0;
    padding: 0
  }

  body, html {
    width: 100%;
    height: 100%
  }

  div {
    display: -webkit-flex;
    display: -moz-flex;
    display: flex
  }
`)



