docs/api/fela/createRenderer.html.body:
createRenderer([config])
Creates a Fela renderer which renders your selectors, keyframes, fonts and static styles.
It caches all rendered styles to be able to reuse them on future rendering cycles.
Arguments

config (Object?): Optional renderer configuration. The most common use case adding plugins to process styles before they get cached. (See Advanced - Renderer Configuration for further information).

Returns
(Renderer): A Renderer instance.
Example
import { createRenderer } from &apos;fela&apos;

const rule = props =&gt; ({
  backgroundColor: &apos;red&apos;,
  fontSize: props.size,
  color: &apos;blue&apos;
})

const renderer = createRenderer()

renderer.render(rule, { size: &apos;12px&apos; }) // =&gt; a b c


console.log(renderer.renderToString())
// .a{background-color:red}
// .b{font-size:12px}
// .c{color:blue}

docs/api/fela/Renderer.html.body:
Renderer
The renderer is the most important utility providing methods to render your styles. It caches every single style that is rendered at any time. Therefore it always has an up-to-date snapshot of your current CSS environment.
You should only have a single renderer which handles all styles of your whole application.
To create a new renderer instance, simply use the createRenderer method to actually get a renderer instance.
Methods

renderRule(rule, [props])
renderKeyframe(keyframe, [props])
renderFont(family, files, [properties])
renderStatic(style, [selector])
renderToString()
subscribe(listener)
clear()

renderRule(rule, [props])
Renders a rule using the props to resolve it.
Arguments

rule (Function): A function which satisfies the rule behavior. It must return a valid style object.
props (Object?): An object containing properties to resolve dynamic rule values. Defaults to an empty object.

Returns
(string): The CSS class name used to render the rule.
Example
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

const rule = props =&gt; ({
  backgroundColor: &apos;red&apos;,
  fontSize: props.size,
  color: &apos;blue&apos;
})

renderer.renderRule(rule, { size: &apos;12px&apos; }) // =&gt; a b c
renderer.renderRule(rule) // =&gt; a c

Tips &amp; Tricks
To write more advanced and/or simpler rules there are some helpful tips &amp; tricks you might want to know and use:

Optional props
Many rules define CSS declarations that semantically belong together e.g. alignItems and justifyContent. Still, you might not want to use both every time. Therefore, Fela supports optional props. If a value is not set and thus undefined or a string containing undefined it is simply removed by default.

const rule = props =&gt; ({
  justifyContent: props.justify,
  alignItems: props.align
})

renderer.renderRule(rule, { justifyContent: &apos;center&apos; }) // =&gt; a
// .a{justify-content:center}


Default declarations
Sometimes you do not pass all props required to completely resolve all style declarations, but want to use a default value in order to not produce any invalid CSS markup. You can achieve this in two ways. Either with ECMA2015 default function parameters or with the logical OR (||) operator.

// default parameters
const rule = ({ color = &apos;red&apos; } = {}) =&gt; ({
  color: color
})

// OR operator
const rule = props =&gt; ({
  color: props.color || &apos;red&apos;
})

rule({ color: &apos;blue&apos; }) // =&gt; { color: &apos;blue&apos; }
rule({ }) // =&gt; { color: &apos;red&apos; }


Conditional values
Some values might only be applied, if a certain condition is fulfilled. Instead of complex and big if statements you can use the ternary operator.

const rule = ({ type }) =&gt; ({
  color: type === &apos;error&apos; ? &apos;red&apos; : &apos;green&apos;
})

rule({ type: &apos;error&apos; }) // =&gt; { color: &apos;red&apos; }
rule({ }) // =&gt; { color: &apos;green&apos; }


renderKeyframe(keyframe, [props])
Renders a keyframe using the props to resolve it.
Arguments

keyframe (Function): A function which satisfies the keyframe behavior. It must return a valid keyframe object.
props (Object?): An object containing properties to resolve dynamic keyframe values. Defaults to an empty object.

Returns
(string): The @keyframes animation name used to render the keyframe.
Example
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

const keyframe = props =&gt; ({
  &apos;0%&apos;: { color: props.initialColor },
  &apos;33%&apos;: { color: &apos;red&apos; },
  &apos;66%&apos;: { color: &apos;green&apos; },
  &apos;100%&apos;: { color: props.initialColor }
})

renderer.renderKeyframe(keyframe, { initialColor: &apos;blue&apos; }) // =&gt; k1
renderer.renderKeyframe(keyframe, { initialColor: &apos;black&apos; }) // =&gt; k2

Tips &amp; Tricks

Be sure to only use animateable properties. Other properties will be ignored.
Keyframe objects must at least have the steps 0% and 100% or rather from and to. Otherwise it might not be used at all.


renderFont(family, files, [properties])
Renders a @font-face rule using the family as reference.
Arguments

family (string): A font family reference which is later required to use this font face.
files (string[]): An array of valid source paths. It may either be relative (within your project) or absolute (hosted on an external server). It must have one of the following file extensions: .woff, .eof, .ttf or .svg.
properties(Object?): Additional font properties which are fontVariant, fontWeight, fontStretch, fontStyle and unicodeRange.

Example
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

const files = [
  &apos;../fonts/Lato.ttf&apos;,
  &apos;../fonts/Lato.woff&apos;,
  &apos;../fonts/Lato.eof&apos;
]

renderer.renderFont(&apos;Lato&apos;, files, { fontWeight: 300 })

Caveats

If you are using relative paths such as ../fonts/Lato.ttf, keep in mind that it is relative to your index.html.


renderStatic(style, [selector])
Renders static styles.
Arguments

style (string|Object): Either a pure CSS string or an object of style declarations.
selector (string): If style is passed as an object you must specify a selector selector.

Example
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

// string type style
renderer.renderStatic(&apos;html,body{box-sizing:border-box;margin:0}&apos;).

// object type style
renderer.renderStatic({
  boxSizing: &apos;border-box&apos;,
  margin: 0
}, &apos;html,body&apos;)

Tips &amp; Tricks

Only use static styles for global CSS rules such as resets.
Use string styles to include legacy and third-party CSS.

Pro Tip
You can even reuse existing formatted CSS using ECMAScript 2015 template strings.
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

renderer.renderStatic(`
html, body {
  box-sizing: border-box;
  margin: 0
}

div {
  display: -webkit-flex;
  display: -moz-flex;
  display: flex
}
`)


renderToString()
Renders all cached styles into a single CSS string. Styles are grouped in the following order:

Fonts
Static Styles
Rules
Media Query Rules (clustered)
Keyframes

Returns
(string): Single concatenated CSS string containing all cached styles by that time.
Example
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

const rule = props =&gt; ({
  fontSize: props.fontSize,
  color: &apos;blue&apos;
})

renderer.renderStatic(&apos;html,body{box-sizing:border-box;margin:0}&apos;).
renderer.renderRule(rule, { fontSize: &apos;12px&apos; })

const markup = renderer.renderToString()

console.log(markup)
// html,body{box-sizing:border-box;margin:0}
// .a{font-size:12px}.b{color:blue}


subscribe(listener)
Adds a change listener to get notified when changes happen.
Arguments

listener (Function): A callback function that is called on every change. It passes a change object containing information on what actually got rendered or changed. Every change object at least has a unique type and optionally some meta data. In addition it passes the renderer that triggered the change.

Returns
(Object): An object containing the corresponding unsubscribe-method.
Example
import { createRenderer } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

const rule = props =&gt; ({
  fontSize: props.fontSize,
  color: &apos;blue&apos;
})

const subscription = renderer.subscribe(console.log)
renderer.renderRule(rule, { fontSize: &apos;12px &apos;})
// { type: &apos;rule&apos;, style: &apos;font-size:12px&apos;, selector: &apos;a&apos;, media: &apos;&apos; }
// { type: &apos;rule&apos;, style: &apos;color:blue&apos;, selector: &apos;b&apos;, media: &apos;&apos; }

// Unsubscribing removes the event listener
subscription.unsubscribe()


clear()
Clears the whole cache and updates the DOM node to remove all CSS rules.

docs/api/fela/combineRules.html.body:
combineRules(...rules)
A common pattern when styling elements is to have some base styles which get applied to every instance as well as some extended styles which get added based on some condition. Just concatenating classNames may lead to specificity problems as the last rendered rule always wins.
To solve this issue, combineRules allows you to compose multiple rules into a single super selector.
Combining rules actually is the best practice in terms of style composition as it prevents property specificity issues by default.
Arguments

...rules (arguments): Functions returning valid style objects.

Returns
(Function) A super selector which composes all rules from left to right.
Example
import { combineRules } from &apos;fela&apos;

const renderer = createRenderer(mountNode)

const rule = props =&gt; ({
  fontSize: props.fontSize
  color: &apos;red&apos;
})

const anotherRule = props =&gt; ({
  color: &apos;blue&apos;
})

const superRule = combineRule(rule, anotherRule)

renderer.renderRule(rule, { fontSize: &apos;12px &apos;}) // =&gt; c1 c2
renderer.renderRule(anotherRule) // =&gt; c3
renderer.renderRule(superRule, { fontSize: &apos;12px&apos; }) // c4 c5

console.log(renderer.renderToString())
// .c1{color:red}.c2{font-size:12px}
// .c3{color:blue}
// .c4{color:blue}.c5{font-size:12px}

docs/api/fela/enhance.html.body:
enhance(...enhancers)
Composes a renderer enhancer to enhance the basic createRenderer function. You can also pass enhancers to createRenderer directly which makes the use of enhance optional.
Arguments

...enhancers (arguments): Functions that enhance the basic renderer object. Each function takes the renderer and modifies its abilities.

Returns
(Function): Renderer enhancer which is used to enhance the createRenderer function.
Example
import { createRenderer, enhance } from &apos;fela&apos;
import perf from &apos;fela-perf&apos;
import beautifier from &apos;fela-beautifier&apos;

const enhancer = enhance(
  perf(),
  beautifier()
)

const createEnhancedRenderer = enhancer(createRenderer)

const enhancedRenderer = createEnhancedRenderer()

You may also directly apply the enhancer using the following short version.
const createEnhancedRenderer = enhance(
  perf(),
  beautifier()
)(createRenderer)

// or even shorter by directly creating the renderer
// but this is not very easy to read though
const renderer = enhance(
  perf(),
  beautifier()
)(createRenderer)()

docs/api/fela-dom/render.html.body:
render(renderer, mountNode)
Renders all cached styles into a DOM node. It also adds a change listener to automatically add newly rendered styles.
Arguments

renderer (Renderer): The renderer providing the styles which are rendered into the mountNode.
mountNode (HTMLElement): DOM node to render your CSS into. In production it must be a  &lt;style&gt; element. Though in development, all other HTMLElements will work too, e.g. if you want to render the CSS into a &lt;div&gt; for debugging.

Example
import { createRenderer } from &apos;fela&apos;
import { render } from &apos;fela-dom&apos;

// You would most likely add an existing &lt;style&gt;-element
// to your index.html and reference it with a special id
const mountNode = document.getElementById(&apos;stylesheet&apos;)

const rule = props =&gt; ({
  backgroundColor: &apos;red&apos;,
  fontSize: props.size,
  color: &apos;blue&apos;
})

const renderer = createRenderer()

renderer.render(rule, { size: &apos;12px&apos; }) // =&gt; a b c

render(renderer, mountNode)

// automatically adds the rule to the stylesheet
renderer.renderRule(rule, { size: &apos;15px &apos;}) // =&gt; a d c
